description:
1888 is a year that Lady Louise Jenson will never forget. The young Victorian inherits the grand London estate, Portland Manor after the sudden passing of her Great Aunt. Immediately a new world of sexual adventure surrounds the stunning girl from the Shires as she and her new found friends indulge in wild sexual Parlour Games. Unique hardcore entertainment as Anjali Kara directs a cinematic Adult feature movie for Daring Media. With genuine Victorian costumes, a great cast and shot in the same location used by the 2011 Academy award winning movie, Portland Manor promises to be a truly unmissable viewing experience.

